import React from 'react'
import Item from "./Item"
import Header from "./Header"
import todosData from "./toDos"

function App() {

    let todos = todosData.map(function(element){
        return <Item name = {element.text} check = {element.completed}/>
    });

    return (
        <div>
            <Header/>
            <Item name = "todo1"/>
            <Item name = "todo2"/>
        </div>

    );
}

export default App;
